    useEffect(() => {
        fetch("./data/quest.json")
    })

    // const data = JSON.parse(questsData)
    // console.log(data[0].title)
    // const data = questsData

  return (
    <div className="card">
      <h3>Quests</h3>
      <ListBox
        value={selectedQuest}
        options={quests}
        onChange={(e) => setSelectedQuest(e.value)}
        optionLabel="name"
        style={{ width: "15rem" }}
      />
    </div>
  );
};

export default QuestList;
